import React from 'react'
import Mapss from '../../assets/img/map-ss.png'

function Maps() {
  return (
    <div>
        <div className="map" id="mapi">
            <img src={Mapss} alt="Map" className="map-img"/>
        </div>
    </div>
  )
}

export default Maps
